import React from "react";

const FishListItem01 = ({ onClick, imgSrc, name, count }) => {
  return (
    <li className="item">
      <a onClick={onClick}>
        <div className="imgWrap imgFish">
          <img src={imgSrc} alt="" />
        </div>
        <div className="InfoWrap">
          <h6>
            {name} <strong className="text-primary">{count}</strong>
          </h6>
        </div>
      </a>
    </li>
  );
};

export default FishListItem01;
